import React from "react";

export default class Botones extends React.Component{
    render(){
        return(
            <div>
                <button onClick={() => alert('Aprobado')}>Módulo 1</button>
                <button onClick={() => alert('En curso')}>Módulo 2</button>
            </div>
        )
    }
}
